import ReactPlayer from "react-player";

import "./flight.css";

class Flight extends Component {

  render() {
      let {flight} = this.props.location.state;
    return <div className='heading'>{flight.mission_name}





    <div className="videoContainer"><ReactPlayer className="videoPlayer" controls={true} volume={null} url={flight.links.video_link}></ReactPlayer></div>

    <div></div>



    </div>;
  }
}

export default Flight;
